syntax = "proto3";
option go_package = "./;client_proto";

option java_package = "emu.grasscutter.net.proto";

import "BrickBreakerPlayerBattleInfo.proto";
import "BrickBreakerStageType.proto";

// Name: CNNGAFGPOEO
message BrickBreakerStageInfo {
  BrickBreakerStageType stage_type = 11;
  uint32 level_id = 7;
  repeated BrickBreakerPlayerBattleInfo battle_info_list = 12;
}
